<node TEXT="scripts" POSITION="right" ID="ID_1652832201" CREATED="1354893964472" MODIFIED="1354893964493">
<edge COLOR="#00007c" WIDTH="3"/>
<richcontent TYPE="NOTE">

<html>
  <head>
    
  </head>
  <body>
    <p>
      An add-on may contain multiple scripts. The node text defines the script name (e.g. inserInlineImage.groovy). Its properties have to be configured via attributes:
    </p>
    <p>
      
    </p>
    <p>
      * menuLocation: &lt;locationkey&gt;
    </p>
    <p>
      &#160;&#160;&#160;- Defines where the menu location.
    </p>
    <p>
      &#160;&#160;&#160;-&#160;See mindmapmodemenu.xml for how the menu locations look like.
    </p>
    <p>
      &#160;&#160;&#160;- http://freeplane.bzr.sf.net/bzr/freeplane/freeplane_program/trunk/annotate/head%3A/freeplane/resources/xml/mindmapmodemenu.xml
    </p>
    <p>
      &#160;&#160;&#160;- This attribute is mandatory
    </p>
    <p>
      
    </p>
    <p>
      * menuTitleKey: &lt;key&gt;
    </p>
    <p>
      &#160;&#160;&#160;- The menu item title will be looked up under the translation key &lt;key&gt; - don't forget to define its translation.
    </p>
    <p>
      &#160;&#160;&#160;- This attribute is mandatory
    </p>
    <p>
      
    </p>
    <p>
      * executionMode: &lt;mode&gt;
    </p>
    <p>
      &#160;&#160;&#160;- The execution mode as described in the Freeplane wiki (http://freeplane.sourceforge.net/wiki/index.php/Scripting)
    </p>
    <p>
      &#160;&#160;&#160;- ON_SINGLE_NODE: Execute the script once. The <i>node</i>&#160;variable is set to the selected node.
    </p>
    <p>
      &#160;&#160;&#160;- ON_SELECTED_NODE: Execute the script n times for n selected nodes, once for each node.
    </p>
    <p>
      &#160;&#160;&#160;- ON_SELECTED_NODE_RECURSIVELY: Execute the script on every selected node and recursively on all of its children.
    </p>
    <p>
      &#160;&#160;&#160;- In doubt use ON_SINGLE_NODE.
    </p>
    <p>
      &#160;&#160;&#160;- This attribute is mandatory
    </p>
    <p>
      
    </p>
    <p>
      * keyboardShortcut: &lt;shortcut&gt;
    </p>
    <p>
      &#160;&#160;&#160;- Optional: keyboard combination / accelerator for this script, e.g. control alt I
    </p>
    <p>
      &#160;&#160;&#160;- Use lowercase letters for modifiers and uppercase for letters. Use no + signs.
    </p>
    <p>
      &#160;&#160;&#160;- The available key names are listed at http://download.oracle.com/javase/1.4.2/docs/api/java/awt/event/KeyEvent.html#VK_0
    </p>
    <p>
      &#160;&#160;&#160;&#160;&#160;In the list only entries with a 'VK_' prefix count. Omit the prefix in the shortcut definition.
    </p>
    <p>
      
    </p>
    <p>
      * Permissions&#160;that the script(s) require, each either false or true:
    </p>
    <p>
      &#160;&#160;&#160;- execute_scripts_without_asking
    </p>
    <p>
      &#160;&#160;&#160;- execute_scripts_without_file_restriction: permission to read files
    </p>
    <p>
      &#160;&#160;&#160;- execute_scripts_without_write_restriction: permission to create/change/delete files
    </p>
    <p>
      &#160;&#160;&#160;- execute_scripts_without_exec_restriction: permission to execute other programs
    </p>
    <p>
      &#160;&#160;&#160;- execute_scripts_without_network_restriction: permission to access the network
    </p>
    <p>
      &#160;&#160;Notes:
    </p>
    <p>
      &#160;&#160;- The set of permissions is fixed.
    </p>
    <p>
      &#160;&#160;- Don't change the attribute names, don't omit one.
    </p>
    <p>
      &#160;&#160;- Set the values either to true or to false
    </p>
    <p>
      &#160;&#160;- In any case set execute_scripts_without_asking to true unless you want to annoy users.
    </p>
  </body>
</html>
</richcontent>
<node TEXT="ExportTermbase.groovy" ID="ID_499338003" CREATED="1354894330862" MODIFIED="1354952188782">
<attribute_layout NAME_WIDTH="280" VALUE_WIDTH="202"/>
<attribute NAME="menuTitleKey" VALUE="addons.exportTsv2col"/>
<attribute NAME="menuLocation" VALUE="/menu_bar/file/exportTermbase"/>
<attribute NAME="executionMode" VALUE="on_single_node"/>
<attribute NAME="keyboardShortcut" VALUE=""/>
<attribute NAME="execute_scripts_without_asking" VALUE="true"/>
<attribute NAME="execute_scripts_without_file_restriction" VALUE="true"/>
<attribute NAME="execute_scripts_without_write_restriction" VALUE="true"/>
<attribute NAME="execute_scripts_without_exec_restriction" VALUE="false"/>
<attribute NAME="execute_scripts_without_network_restriction" VALUE="false"/>
<node TEXT="// @ExecutionModes({ON_SINGLE_NODE})&#xd;&#xa;import groovy.xml.MarkupBuilder&#xd;&#xa;&#xd;&#xa;import org.freeplane.core.util.LogUtils&#xd;&#xa;import org.freeplane.plugin.script.proxy.Proxy&#xd;&#xa;&#xd;&#xa;import javax.xml.transform.TransformerFactory&#xd;&#xa;import javax.xml.transform.stream.StreamResult&#xd;&#xa;import javax.xml.transform.stream.StreamSource&#xd;&#xa;import javax.xml.transform.OutputKeys&#xd;&#xa;import javax.xml.transform.Transformer&#xd;&#xa;&#xd;&#xa;import tmf.Tdc&#xd;&#xa;def run(Proxy.Node node, Proxy.Controller c){&#xd;&#xa;&#x9;&#xd;&#xa;&#x9;String directory=c.getUserDirectory().toString()+&apos;\\&apos;&#xd;&#xa;&#x9;Tdc tdc = new Tdc(node.id)&#xd;&#xa;&#x9;String filename=tdc.populate(node)&#xd;&#xa;&#x9;def writer= new OutputStreamWriter(new FileOutputStream(directory+filename+&apos;.gmt&apos;),&apos;utf-8&apos;)&#xd;&#xa;&#x9;def xml = new MarkupBuilder(writer)&#xd;&#xa;&#x9;xml.mkp.xmlDeclaration version: &apos;1.0&apos;, encoding: &apos;UTF-8&apos;&#xd;&#xa;&#x9;tdc.toGmt(xml)&#xd;&#xa;&#x9;writer.close()&#xd;&#xa;&#x9;LogUtils.info(&apos;ExportTermbase&#x9;Saving the GMT file in: &apos;+directory+filename+&apos;.gmt&apos;)&#xd;&#xa;&#x9;&#xd;&#xa;&#x9;// Load xslt&#xd;&#xa;&#x9;def xslt= new File(directory+&apos;resources\\xsl\\gmt2tsv.xsl&apos;).getText()&#xd;&#xa;// Create transformer&#xd;&#xa;&#x9;def transformer = TransformerFactory.newInstance().newTransformer(new StreamSource(new StringReader(xslt)))&#xd;&#xa;&#x9;transformer.setOutputProperty(OutputKeys.METHOD, &quot;text&quot;)&#xd;&#xa;&#x9;transformer.setOutputProperty(OutputKeys.MEDIA_TYPE, &quot;text/tab-separated-values&quot;)&#xd;&#xa;&#x9;transformer.setOutputProperty(OutputKeys.INDENT, &quot;no&quot;)&#xd;&#xa;&#x9;// Load xml&#xd;&#xa;&#x9;def gmtFile= new File(directory+filename+&apos;.gmt&apos;).getText()&#xd;&#xa;&#x9;def tsvFile = new FileOutputStream(directory+filename+&apos;.tsv&apos;)&#xd;&#xa;&#x9;// Perform transformation&#xd;&#xa;&#x9;transformer.transform(new StreamSource(new StringReader(gmtFile)), new StreamResult(tsvFile))&#xd;&#xa;&#x9;LogUtils.info(&apos;ExportTermbase&#x9;Saving the TSV file in: &apos;+directory+filename+&apos;.tsv&apos;)&#xd;&#xa;&#x9;tsvFile.close()&#xd;&#xa;&#x9;}&#xd;&#xa;&#x9;&#xd;&#xa;run(node, c)&#xd;&#xa;" ID="ID_1721169029" CREATED="1355575112244" MODIFIED="1355575112405"/>
</node>
</node>
<node TEXT="zips" POSITION="right" ID="ID_1339660549" CREATED="1354893964507" MODIFIED="1354893964519">
<edge COLOR="#007c00" WIDTH="3"/>
<richcontent TYPE="NOTE">

<html>
  <head>
    
  </head>
  <body>
    <p>
      An add-on may contain any number of nodes containing zip files.
    </p>
    <p>
      
    </p>
    <p>
      &#160;- The immediate child nodes contain a description of the zip. The devtools script releaseAddOn.groovy allows automatic zip creation if the name of this node matches a directory in the current directory.
    </p>
    <p>
      
    </p>
    <p>
      &#160;- The child nodes of these nodes contain the actual zip files.
    </p>
    <p>
      
    </p>
    <p>
      &#160;- Any zip file will be extracted in the &lt;installationbase&gt;. Currently, &lt;installationbase&gt; is always Freeplane's &lt;userhome&gt;, e.g. ~/.freeplane/1.2.
    </p>
    <p>
      
    </p>
    <p>
      &#160;- The files will be processed in the sequence as seen in the map.
    </p>
    <p>
      
    </p>
    <p>
      &#160;- Zip files must be uploaded into the map via the script <i>Tools-&gt;Scripts-&gt;Insert Binary</i>&#160;since they have to be (base64) encoded as simple strings.
    </p>
  </body>
</html>
